li&gt; Memory: 2.70 TiB &lt;/li&gt;\n          &lt;li&gt; Dask Version: 2021.11.2 &lt;/li&gt;\n          &lt;li&gt; Dask.Distributed Version: 0+unknown &lt;/li&gt;\n        &lt;/ul&gt;\n        &lt;h2&gt; Calling Code &lt;/h2&gt;\n        &lt;pre&gt;\nimport h5py\nimport os\nimport dask.array as da\nimport dask\nfrom dask.distributed import performance_report, Client\nimport json \nfrom dask_ml.decomposition import IncrementalPCA\nimport time \nimport yaml\n\n#Scheduler file name and configuration file\nscheduler_info = 'scheduler.json'\nconfig_file = 'config.yml'\n\ndef connect(sched_file):\n    with open(sched_file) as f:\n        s = json.load(f)\n    adr = s[\"address\"]\n    try:\n        client  = Client(adr) #, timeout=60, heartbeat_interval=10)\n        print(\"client connected\", flush=True)\n    except Exception as e:\n        print(\"retrying ...\", flush=True)\n        client = Client(adr) #, timeout=60, heartbeat_interval=10)\n    return client\n\n\n# Get client\nclient = connect(scheduler_info)\ndask.config.set({\"distributed.deploy.lost-worker-timeout\": 60, \"distributed.workers.memory.spill\":0.97, \"distributed.workers.memory.target\":0.95, \"distributed.workers.memory.terminate\":0.99 })\n\nwith open(config_file) as file:\n    data = yaml.load(file, Loader=yaml.FullLoader)\n    chun= data[\"chunks\"]\n\nchuny=int(chun[\"width\"])\nchunx=int(chun[\"height\"])\nprint(\"chunks\", chunx, chuny)\n\n\n\nwith performance_report(filename=\"dask-report.html\"): \n    t = time.time()\n    f = h5py.File('data.h5', 'r') \n    d = f['local_t']\n    print(d, flush=True)\n    gt = da.from_array(d, chunks=(1,chunx,chuny))\n    \n    pca=IncrementalPCA(n_components=2,copy=False, svd_solver='randomized')\n    print(\"pca, \", pca, flush=True)\n    for i in range(len(gt)):\n        pca.partial_fit(gt[i])\n    #l = pca.fit(gt, [\"t\", \"X\", \"Y\"], [\"X\"], [\"Y\"])\n    #print(\"this is l :\", l, flush=True)\n\n    cpt = [pca.explained_variance_ ,   pca.singular_values_ ]\n    # Submit the task graph to the scheduler\n\n    #explained_variance , singular_values = client.persist(cpt)\n    #arrays.validate_contract()   \n    #explained_variance , singular_values = client.compute([explained_variance ,singular_values])\n    print(\"explained_variance ,singular_values\", cpt , flush=True )\n\nprint(\"Done in \", time.time() -t , \" secondes\")\n    \nos.remove('data.h5') \nclient.shutdown()\n\n        &lt;/pre&gt;\n        "},"id":"1401","type":"Div"},{"attributes":{"axis":{"id":"1126"},"coordinates":null,"dimension":1,"group":null,"ticker":null},"id":"1129","type":"Grid"},{"attributes":{},"id":"1049","type":"BasicTicker"},{"attributes":{},"id":"1501","type":"Selection"},{"attributes":{"follow":"end","follow_interval":20000,"range_padding":0},"id":"1215","type":"DataRange1d"},{"attributes":{"bottom":{"field":"bottom"},"fill_alpha":{"value":0.2},"fill_color":{"field":"color"},"hatch_alpha":{"value":0.2},"hatch_color":{"field":"color"},"left":{"field":"left"},"line_alpha":{"value":0.2},"line_width":{"value":2},"right":{"field":"right"},"top":{"field":"top"}},"id":"1069","type":"Quad"},{"attributes":{"coordinates":null,"group":null,"render_mode":"css","source":{"id":"1214"},"text":{"field":"cpu"},"text_font_size":{"value":"1em"},"x":{"field":"x"},"x_units":"screen","y":{"field":"y"},"y_units":"screen"},"id":"1247","type":"LabelSet"},{"attributes":{"format":"0.0 b"},"id":"1207","type":"NumeralTickFormatter"},{"attributes":{},"id":"1127","type":"BasicTicker"},{"attributes":{},"id":"1161","type":"CategoricalScale"},{"attributes":{},"id":"1231","type":"BasicTicker"},{"attributes":{"data":{"cpu":{"__ndarray__":"AAAAAAAAEEAAAAAAAAAQQAAAAAAAAABAAAAAAAAAEEAAAAAAAAAAQAAAAAAAABBAAAAAAAAAEEAAAAAAAAAAQAAAAAAAABBAAAAAAAAAEEAAAAAAAAAgQAAAAAAAAABAAAAAAAAAIEAAAAAAAAAAQAAAAAAAAABAAAAAAAAAAEAAAAAAAAAAQAAAAAAAABhAAAAAAAAAAAAAAAAAAAAQQAAAAAAAABBAAAAAAAAAAEAAAAAAAAAAQAAAAAAAABBAAAAAAAAAAEAAAAAAAAAQQAAAAAAAAABAAAAAAAAAAEAAAAAAAAAQQAAAAAAAACBAAAAAAAAAEEAAA
